import React from "react";
import "./App.css";
import "bulma/bulma";
import { Title } from "./components/Title";
import { SearchForm } from "./components/SearchForm";
function App() {
  return (
    <div className="App">
      <Title>Buscador de peliculas</Title>
      <SearchForm />
    </div>
  );
}

export default App;
